import React from 'react';

const About = () => {
  return (
    <section id="about" className="py-24 px-6 bg-white text-gray-800">
      <div className="max-w-4xl mx-auto text-center">
        <h3 className="text-3xl font-bold mb-6">About Finlytiq</h3>
        <p className="text-lg">
          Finlytiq LLP was founded with the vision to bring intelligence, automation, and strategic clarity
          to every financial decision for startups and growing businesses. With a team of experienced
          Chartered Accountants, tax professionals, and consultants, we offer unmatched guidance and
          measurable value.
        </p>
      </div>
    </section>
  );
};

export default About;
